import GameCard from "./gameCard";


export default function GameCards(games){
    return (
        <div>
        {games.map(g=>{
            <gameCard key={g.id}
            name={g.name} 
            image={g.image}
            genres={g.genres}
            />})
        }
        </div>
    )
}
